TEST_F(TestSrcPWForceMultiDevice, cal_vkb1_nl_op_cpu)
{
    std::vector<std::complex<double>> res = vkb1;
    hamilt::cal_vkb1_nl_op<double, psi::DEVICE_CPU>()(
        cpu_ctx,
        nkb,
        npwx,
        npwk_max,
        vkb_nc,
        nbasis,
        ik,
        ipol,
        NEG_IMAG_UNIT,
        vkb.data(),
        gcar.data(),
        res.data());

    for (int ii = 0; ii < res.size(); ii++) {
        EXPECT_LT(std::abs(res[ii] - expected_vkb1[ii]), 6e-5);
    }
}

TEST_F(TestSrcPWForceMultiDevice, cal_force_nl_op_cpu)
{
    std::vector<double> res(expected_force.size(), 0.0);
    hamilt::cal_force_nl_op<double, psi::DEVICE_CPU>()(
        cpu_ctx,
        multi_proj,
        nbands_occ,
        wg_nc,
        ntype,
        spin,
        deeq_2,
        deeq_3,
        deeq_4,
        forcenl_nc,
        nbands,
        ik,
        nkb,
        atom_nh.data(),
        atom_na.data(),
        tpiba,
        wg.data(),
        deeq.data(),
        becp.data(),
        dbecp.data(),
        res.data());

    for (int ii = 0; ii < res.size(); ii++) {
        EXPECT_LT(fabs(res[ii] - expected_force[ii]), 6e-5);
    }
}

